import React, { useState, useEffect } from 'react';
import axios from 'axios';

const EmployeeList = ({ contractId }) => {
  const [employees, setEmployees] = useState([]);
  const [form, setForm] = useState({});
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    const fetchEmployees = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/employees`);
        setEmployees(response.data);
      } catch (error) {
        console.error('Error fetching employees:', error);
      }
    };

    fetchEmployees();
  }, [contractId]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleAddEmployee = async () => {
    try {
      const response = await axios.post(`http://localhost:5000/api/contracts/${contractId}/employees`, form);
      setEmployees([...employees, response.data]);
      setForm({});
    } catch (error) {
      console.error('Error adding employee:', error);
    }
  };

  const handleEditEmployee = async (id) => {
    try {
      const response = await axios.put(`http://localhost:5000/api/contracts/${contractId}/employees/${id}`, form);
      setEmployees(employees.map(emp => (emp._id === id ? response.data : emp)));
      setIsEditing(false);
      setForm({});
    } catch (error) {
      console.error('Error updating employee:', error);
    }
  };

  const handleDeleteEmployee = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/contracts/${contractId}/employees/${id}`);
      setEmployees(employees.filter(emp => emp._id !== id));
    } catch (error) {
      console.error('Error deleting employee:', error);
    }
  };

  const handleEditClick = (employee) => {
    setIsEditing(true);
    setForm(employee);
  };

  return (
    <div>
      <h3>Employee Details</h3>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>EPF</th>
            <th>ESIC</th>
            <th>Bank Account</th>
            <th>Aadhar</th>
            <th>Mobile No.</th>
            <th>Daily Wage</th>
            <th>Job Role</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {employees.map(employee => (
            <tr key={employee._id}>
              <td>{employee.name}</td>
              <td>{employee.epf}</td>
              <td>{employee.esic}</td>
              <td>{employee.bankAccount}</td>
              <td>{employee.aadhar}</td>
              <td>{employee.mobileNo}</td>
              <td>{employee.dailyWage}</td>
              <td>{employee.jobRole}</td>
              <td>
                <button onClick={() => handleEditClick(employee)}>Edit</button>
                <button onClick={() => handleDeleteEmployee(employee._id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div>
        <input name="name" placeholder="Name" value={form.name || ''} onChange={handleChange} />
        <input name="epf" placeholder="EPF" value={form.epf || ''} onChange={handleChange} />
        <input name="esic" placeholder="ESIC" value={form.esic || ''} onChange={handleChange} />
        <input name="bankAccount" placeholder="Bank Account" value={form.bankAccount || ''} onChange={handleChange} />
        <input name="aadhar" placeholder="Aadhar" value={form.aadhar || ''} onChange={handleChange} />
        <input name="mobileNo" placeholder="Mobile No." value={form.mobileNo || ''} onChange={handleChange} />
        <input name="dailyWage" placeholder="Daily Wage" value={form.dailyWage || ''} onChange={handleChange} />
        <input name="jobRole" placeholder="Job Role" value={form.jobRole || ''} onChange={handleChange} />
        {isEditing ? (
          <button onClick={() => handleEditEmployee(form._id)}>Update Employee</button>
        ) : (
          <button onClick={handleAddEmployee}>Add Employee</button>
        )}
      </div>
    </div>
  );
};

export default EmployeeList;
